import React from 'react';
import { Signup } from './Signup';


function SignupLayout () {
  return (
    <div className='container mt-3'>
      <div className='row'>
        <div className='col-md-5'>
          <Signup />
        </div>
      </div>
    </div>
  );
}

export default SignupLayout;
